import MyButton from './MyButton';
import './App.css';
import React, { useState } from 'react';


function App() {
  const [age,setAge]=useState(0)

  function incAge(){
    setAge(age+1);
  }
  function decAge(){
    setAge(age-1)
}


  return (
    <div className="App">
      <h1>Welcom to React hooks</h1>
      <MyButton age={age} onClick={incAge}/>
      <MyButton age={age} onClick={decAge}/>



    </div>
  );
}

export default App;
